import React from 'react';
import Home from '../pages/Home';

function App() {
    return (
        <div className="min-h-screen bg-gray-100">
        <h1 className="text-4xl font-bold text-center my-6 text-blue-600">
        Welcome to MovieFlix!
        </h1>
        <Home />
        </div>
  );
}
export default App;
